import DateTime from "react-datetime";
import "./summary.scss";

const Summary = () => {
    return (
        <div className="dash">
            <div className="container">
                <p>Seleccionar Periodo</p>
                <DateTime dateFormat="DD-MM-YYYY" timeFormat={false} />
                <DateTime dateFormat="DD-MM-YYYY" timeFormat={false} />
                <button>Buscar</button>
            </div>
        </div>
    )
}

export default Summary
